import React from 'react';
import { Box, Typography } from '@mui/material';

function ProgressBar({ years, selectedYear, onYearSelect }) {
  return (
    <Box sx={{
      width: '100%',
      p: 2,
      background: 'rgba(26, 44, 78, 0.8)',
      backdropFilter: 'blur(10px)',
      borderBottom: '1px solid rgba(255, 255, 255, 0.12)'
    }}>
      <Box sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        position: 'relative',
        maxWidth: 1200,
        margin: '0 auto',
        gap: 2
      }}>
        <Box
          onClick={() => onYearSelect(null)}
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            position: 'relative',
            zIndex: 1,
            cursor: 'pointer'
          }}
        >
          <Box sx={{
            width: 24,
            height: 24,
            borderRadius: '50%',
            bgcolor: selectedYear === null ? '#00f5ff' : 'rgba(255, 255, 255, 0.23)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            transition: 'all 0.3s ease',
            border: selectedYear === null ? '2px solid #00f5ff' : 'none',
            boxShadow: selectedYear === null ? '0 0 10px #00f5ff' : 'none',
            '&:hover': {
              bgcolor: '#00f5ff',
              opacity: 0.8
            }
          }} />
          <Typography
            variant="caption"
            sx={{
              mt: 1,
              color: selectedYear === null ? '#00f5ff' : 'rgba(255, 255, 255, 0.7)',
              transition: 'color 0.3s ease'
            }}
          >
            All
          </Typography>
        </Box>

        {years.map((year, index) => (
          <React.Fragment key={year}>
            <Box
              sx={{
                flexGrow: 1,
                height: 1,
                bgcolor: 'rgba(255, 255, 255, 0.12)',
                position: 'relative',
                top: 12,
                width: '50px',
                '&::before': {
                  content: '""',
                  position: 'absolute',
                  left: 0,
                  top: 0,
                  height: '100%',
                  width: selectedYear && year <= selectedYear ? '100%' : '0%',
                  bgcolor: '#00f5ff',
                  transition: 'width 0.3s ease'
                }
              }}
            />
            <Box
              onClick={() => onYearSelect(year)}
              sx={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                position: 'relative',
                zIndex: 1,
                cursor: 'pointer'
              }}
            >
              <Box sx={{
                width: 24,
                height: 24,
                borderRadius: '50%',
                bgcolor: selectedYear === year ? '#00f5ff' : 'rgba(255, 255, 255, 0.23)',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                transition: 'all 0.3s ease',
                border: selectedYear === year ? '2px solid #00f5ff' : 'none',
                boxShadow: selectedYear === year ? '0 0 10px #00f5ff' : 'none',
                '&:hover': {
                  bgcolor: '#00f5ff',
                  opacity: 0.8
                }
              }} />
              <Typography
                variant="caption"
                sx={{
                  mt: 1,
                  color: selectedYear === year ? '#00f5ff' : 'rgba(255, 255, 255, 0.7)',
                  transition: 'color 0.3s ease'
                }}
              >
                {year}
              </Typography>
            </Box>
          </React.Fragment>
        ))}
      </Box>
    </Box>
  );
}

export default ProgressBar;
